const products = [
  {
    _id: '1',
    name: 'ALL TIME LOW Don’t Panic: It’s Longer Now Orange Vinyl',
    image: '/images/ALL-TIME-LOW-Dont-Panic-Its-Longer-Now-Orange-Vinyl.webp',
    description:
